import { makeStyles } from "@mui/styles";


export const useStyles = makeStyles({
  container:{
    width:"100%",
    marginTop:200
  },
  getStarted:{
    width:480,
    margin:"0 auto"
  },
  text:{
    '& p':{
      letterSpacing:2.25,
      textAlign:'center',
      fontSize:64,
      fontWeight:'bold',
    }

  }
})
